import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import IconButton from '@mui/material/IconButton';
import MenuItem from '@mui/material/MenuItem';
import SvgIcon from '@mui/material/SvgIcon';
import Menu from '@mui/material/Menu';

// Icons
import HomeIcon from '@mui/icons-material/Home';
import SettingsIcon from '@mui/icons-material/Settings';

function PillIcon(props) {
    return (
        <SvgIcon {...props}>
            <path
                d="M330.67,0a137.71,137.71,0,0,0-98.05,40.62l-192,192A137.82,137.82,0,0,0,0,330.67c0,76.45,62.21,138.66,138.67,138.66a137.66,137.66,0,0,0,98-40.61l192-192a137.72,137.72,0,0,0,40.62-98.06C469.33,62.21,407.12,0,330.67,0ZM149.88,213.88l-64,64A74.21,74.21,0,0,0,64,330.67a10.67,10.67,0,0,1-21.33,0,95.36,95.36,0,0,1,28.12-67.89l64-64a10.67,10.67,0,0,1,15.09,15.09Zm248.66-7.32L310.08,295,174.33,159.24l88.46-88.46A96,96,0,1,1,398.54,206.56Z"/>
        </SvgIcon>
    );
}

export default function MenuAppBar() {
    const [auth, setAuth] = React.useState(true);
    const [anchorEl, setAnchorEl] = React.useState(null);

    const handleMenu = (event) => {
        setAnchorEl(event.currentTarget);
    };

    const handleClose = () => {
        setAnchorEl(null);
    };

    return (
        <Box>
            <AppBar position="static">
                <Toolbar>
                    <IconButton
                        size="large"
                        edge="start"
                        color="inherit"
                        aria-label="medications"
                        sx={{mr: 2}}
                    >
                        <PillIcon/>
                    </IconButton>

                    <IconButton
                        size="large"
                        edge="start"
                        color="inherit"
                        aria-label="menu"
                        sx={{mr: 2}}
                    >
                        <HomeIcon/>
                    </IconButton>

                    {auth && (
                        <div>
                            <Typography variant="h6" component="div" sx={{flexGrow: 1}}>
                                Help
                            </Typography>

                            <IconButton
                                size="large"
                                aria-label="account of current user"
                                aria-controls="menu-appbar"
                                aria-haspopup="true"
                                onClick={handleMenu}
                                color="inherit"
                            >
                                <SettingsIcon/>
                            </IconButton>
                            <Menu
                                id="menu-appbar"
                                anchorEl={anchorEl}
                                anchorOrigin={{
                                    vertical: 'top',
                                    horizontal: 'right',
                                }}
                                keepMounted
                                transformOrigin={{
                                    vertical: 'top',
                                    horizontal: 'right',
                                }}
                                open={Boolean(anchorEl)}
                                onClose={handleClose}
                            >
                                <MenuItem onClick={handleClose}>Profile</MenuItem>
                                <MenuItem onClick={handleClose}>My account</MenuItem>
                            </Menu>
                        </div>
                    )}
                </Toolbar>
            </AppBar>
        </Box>
    );
}
